​​​​​​​​​​​​​​요즘 날도 추워지고..여행가기 딱 좋은 날씨라지요~♪♬​그래서벚꽃여왕네는 며칠 뒤 가족여행을 가기로 했답니다~​여기서 잠깐!아이가 있는집은 아시죠?이것 저것 짐이 한보따리..1박2일 여행에도 왜이리 챙길게 많은건지..​챙기다 보면이것도 넣고 싶고 저것도 넣고 싶고..ㅎㅎ​그 중에서도 매번 여행 갈때마다 고민되는게 있는데바로 바디로션!​요거 은근 고민이라지요집에서 사용하는건 모두 큰용량이라 통째로 들고가기에도 그렇고그러자니 건조해지는 요즘 안챙기기도 그렇고..고민인 벚꽃여왕인데요​어떠세요??​챙긴다 VS 안챙긴다​​이제 고민하지 마시고 챙기세요!​​​쿤달바디로션 싱글파우치로 고민 끝이랍니다^^​​​​​자연 유래 바디로션쿤달바디로션 싱글파우치는알로에베라잎 추출물 82%유해 의심 성분 무첨가!그리고 피부진정에 도움을 주는 병풀추출물 함유와식약처 주름+미백에 도움을 주는 2중 기능성 화장품 보고로자연유래성분 98.9% 함유!​안심하고 사용할 수 있는 바디로션이랍니다^^​​​​​​한 박스에는30개의 쿤달바디로션 싱글파우치가 들어 있어요^^​​​​​​부담없이 가볍게 하나씩 쏙!​여행이나 외출시에간편하게 사용하기 좋답니다^^​​​​​2019 소비자 만족 브랜드 대상​800만개 판매신화 쿤달에서어디서나 간편하게 사용할 수 있는 싱글파우치쿤달바디로션!​​​터질까,샐까 걱정 없는일회용 파우치로언제 어디서나 간편하게 사용할 수 있는쿤달바디로션 싱글파우치예요​​​​​​용량은 10ml​부족하지 않은넉넉한 용량으로 모자르지 않게 사용할 수 있어요^^​​​​​이지컷으로그대로 간편하게 개봉해서 사용할 수 있어요​​​​​겨울이 되면 특히나 더건조해지는 피부.씻고 나면 더 건조해지는거 같아요ㅠㅠ​건조한 다리에쿤달바디로션 싱글파우치를 발라주었어요​베이비파우더향이 확~>ㅁ<벚꽃여왕은 아이 엄마라 그런지이 향이 너무 좋더라구요진하지도 않고 은은하게 피부에 퍼지는 베이비파우더 향~♡​친근하면서 포근한 향에 기분UP!​​​​​​​​부드럽게 피부에 흡수되면서촉촉하게 스며들며사용 후에도 끈적이거나 답답하지 않은쿤달바디로션이예요^^​​​​벚꽃여왕은 똥똥한 편이라10ml 모자르지 않을까 했는데..전혀요!넉넉하게 듬뿍 발랐답니다^^​양이 적을까 걱정은 안해셔도 될거 같아요~♪♬​​​​​​​1개당 한명씩!​며칠 뒤 여행과1월에 가는 해외여행에서도무겁지 않고 가볍게 쏙!​​​​​작은 사이즈라 주머니나 파우치,가방에 가볍게 챙길 수 있어 너무 좋은쿤달바디로션 싱글파우치​​​​쿤달바디로션 싱글파우치로이제간편하게 떠나세요~♪♬​​​​​★쿤달바디로션 싱글파우치 보러가기★▼▼▼▼▼▼▼http://www.kundal.co.kr/​​​​​​0;

